import "./Home.css";
import Social from "./Social";
import Navbar from "./Navbar";

function Home() {
  return (
    <>
          <style>
        {`
          html, body {
            background-color: #F3F6F4;
          }

        .hovered-vdo {
          background-image: linear-gradient(rgba(0, 0, 0, 0.527),rgba(0, 0, 0, 0.5)), url("https://64.media.tumblr.com/9eaa9c7f490bb019d1bc31ed6e564f7b/7c267b20b21ac5fb-63/s540x810/9b3111e4d6510b659275737f0f53dcdcf9600231.gif");
          background-size: cover;
          background-repeat: no-repeat;
          object-fit: cover;
        `}
      </style>
    <div className="all">
      <Navbar />
      <div className="text">
        <div className="text-kr">
          <h1>갓세븐</h1>
        </div>
        <div className="text-en">
          <h1>GOT7</h1>
        </div>
      </div>
      <div className="home-button">
        <button>HOME FEED</button>
      </div>
      <Social />
    </div>
    </>
  );
}
export default Home;
